window.bookSummaryJSON = "<p>In <i>Whiskey Sour</i>, Chicago police Lieutenant Jacqueline \"Jack\" Daniels hunted down a killer dubbed \"The Gingerbread Man.\"</p> <p>In <i>Bloody Mary</i>, she busted a psychopath with a penchant for dismemberment. </p> <p>In <i>Rusty Nail</i>, it was a serial killer with a doozy of a family tree. </p> <p>And now, in <i>Dirty Martini</i>, Jack faces her toughest adversary yet: a sicko who's poisoning the city's food supply. But that's just the start of what he has planned, because he's aiming to kill fifty thousand people in the single biggest act of terrorism the US has ever seen. Can she stop him—and decide whether to accept boyfriend Latham's surprise proposal—without destroying both her reputation and her sanity? </p> <p>Join Jack, her partner Herb, and her nemesis Harry McGlade, for her fourth, and greatest, case so far. </p>"; 
